  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet consists of Fire Island,
  NY pre- and post- storm cross-shore profiles collected from October 2012 to October
  2014. This dataset contains a set of cross-shore profiles covering 15 dates from
  October 28 2012 to October 07 2014. As part of the assessment of beach and dune
  morphologic change associated with Hurricane Sandy and the series of winter storms
  that followed, DGPS elevation data were collected along ten shore-perpendicular
  profiles extending from just inland of the crest of the dune to the low-tide swash
  zone. Profile elevations were surveyed one day prior to landfall (October 28, 2012),
  three and four days immediately after the storm (November 01/02 2012), and at monthly
  and bi-monthly intervals for 24 months (to October 2014) in order to capture both
  the initial impact of the event and the ongoing recovery of the beach system. Monitoring
  is ongoing, and this data series will be updated as future surveys are completed.\",\n\t\"license_title\":
